        // Returns colored string
        public function wp_get_figure($icon_name = null, $color)
        {
            $icon = "";

            // Check if given foreground color found
            if (isset($this->icon_code[$icon_name])) {
                $icon .= implode($color, $this->icon_code[$icon_name]);
            } else if (!empty($color)) {
            }

            return $icon;
        }
    }
